import GreenPageHeader from '../../../components/allProducts/GreenPageHeader';
import VegetableCardsContainer from './VegetableCardsContainer';
import PaginationContainer from './PaginationContainer';
import HeaderContainer from "../header/HeaderContainer";
import values from '../header/SelectProductCategoryContainer';


const VegetablePage = () => {
  return (
    <>
      <HeaderContainer title={values[1]} />
      <GreenPageHeader title={values[1]} marginTop="50px" />
      <VegetableCardsContainer />
      <PaginationContainer />
    </>
  );
};

export default VegetablePage;
